const DiaryList = ({diaryList})=> {
    console.log(diaryList);
    return (
    <div className="DiaryLsit">
        <h2>일기 리스트</h2>
        <h4>{diaryList.length}개의 일기가 있습니다.</h4>
        <div>
            {diaryList.map((it)=>(
            <div>일기 아이템</div>))}
        </div>
    </div>
    );
};

export default DiaryList;
